import React, { useState } from "react";
import {
  useDeleteFlightTypeMutation,
  useGetFlightTypesQuery,
  useUpdateFlightTypeMutation,
} from "../../redux/api/flightTypeApi";
import toast from "react-hot-toast";

const FlightTypeList = () => {
  const { data, isLoading } = useGetFlightTypesQuery();
  const [deleteFlightType] = useDeleteFlightTypeMutation();
  const [updateFlightType] = useUpdateFlightTypeMutation();

  const [editing, setEditing] = useState(null);
  const [editData, setEditData] = useState({});

  const handleEdit = (flight) => {
    setEditing(flight._id);
    setEditData({ ...flight });
  };

  const handleUpdate = async () => {
    const form = new FormData();
    Object.entries(editData).forEach(([key, val]) => form.append(key, val));
    try {
      await updateFlightType({ id: editing, data: form }).unwrap();
      toast.success("Flight Type updated");
      setEditing(null);
    } catch {
      toast.error("Failed to update");
    }
  };

  const handleDelete = async (id) => {
    if (window.confirm("Delete this flight type?")) {
      try {
        await deleteFlightType(id).unwrap();
        toast.success("Deleted successfully");
      } catch {
        toast.error("Deletion failed");
      }
    }
  };

  return (
    <div className="mt-4">
      <h4>Flight Type List</h4>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Name</th>
            <th>Capacity</th>
            <th>Description</th>
            <th>Max Speed</th>
            <th>Image</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {isLoading ? (
            <tr>
              <td colSpan={6}>Loading...</td>
            </tr>
          ) : (
            data?.flightTypes?.map((flight) => (
              <tr key={flight._id}>
                <td>
                  {editing === flight._id ? (
                    <input
                      value={editData.name}
                      onChange={(e) =>
                        setEditData({ ...editData, name: e.target.value })
                      }
                    />
                  ) : (
                    flight.name
                  )}
                </td>
                <td>
                  {editing === flight._id ? (
                    <input
                      type="number"
                      value={editData.capacity}
                      onChange={(e) =>
                        setEditData({ ...editData, capacity: e.target.value })
                      }
                    />
                  ) : (
                    flight.capacity
                  )}
                </td>
                <td>
                  {editing === flight._id ? (
                    <textarea
                      value={editData.description}
                      onChange={(e) =>
                        setEditData({
                          ...editData,
                          description: e.target.value,
                        })
                      }
                    />
                  ) : (
                    flight.description
                  )}
                </td>
                <td>
                  {editing === flight._id ? (
                    <input
                      type="number"
                      value={editData.maxSpeed}
                      onChange={(e) =>
                        setEditData({ ...editData, maxSpeed: e.target.value })
                      }
                    />
                  ) : (
                    flight.maxSpeed
                  )}
                </td>
                <td>
                  {flight.image?.url && (
                    <img src={flight.image.url} alt={flight.name} width="80" />
                  )}
                </td>
                <td>
                  {editing === flight._id ? (
                    <>
                      <button
                        className="btn btn-sm btn-success me-2"
                        onClick={handleUpdate}
                      >
                        Save
                      </button>
                      <button
                        className="btn btn-sm btn-secondary"
                        onClick={() => setEditing(null)}
                      >
                        Cancel
                      </button>
                    </>
                  ) : (
                    <>
                      <button
                        className="btn btn-sm btn-warning me-2"
                        onClick={() => handleEdit(flight)}
                      >
                        Edit
                      </button>
                      <button
                        className="btn btn-sm btn-danger"
                        onClick={() => handleDelete(flight._id)}
                      >
                        Delete
                      </button>
                    </>
                  )}
                </td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default FlightTypeList;
